  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Des Lacs Migratory
  Waterfowl Refuge outlines Refuge accomplishments from May through July of 1941.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, and disease- is also covered. The Refuge development and maintenance
  section discusses physical developments and plantings. Resource management is outlined;
  topics include grazing. The public relations section of the report describes recreational
  uses and Refuge visitors.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
